using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Text;
using WebTask.Lib.DAL.Core;

namespace WebTask.Lib
{
    public class DbInitializer
    {
        
       
        public static void Initialize(DbContextOptions option)
        {
            DBTaskContext context = new DBTaskContext(option);
            context.Database.EnsureDeleted();
            context.Database.EnsureCreated();

            StatusTable[] statuses =  {
                new StatusTable { Id = 1, Name = "New" },
                new StatusTable { Id = 2, Name = "Work" },
                new StatusTable { Id = 3, Name = "Finish" }
            };
            foreach (var status in statuses)
            {
                context.Add(status);
            }

            List<FileTable> f = new()
            {
                AddFile(context)
            };

            context.Add(new TaskTable { Created = DateTime.Now, Name = "Task test", StatusId = 1, Files= f });
            context.Add(new TaskTable { Created = DateTime.Now, Name = "Task test1", StatusId = 1, Files=f });
            context.Add(new TaskTable { Created = DateTime.Now, Name = "Task test2", StatusId = 3, Files = new List<FileTable>()
            {
                AddFile(context)
            }
        });

            context.SaveChanges();

        }

        private static FileTable AddFile(DbContext context)
        {
            var id = Guid.NewGuid();
            //var data = FileHelper.GetByte(@"D:\z.xlsx");
            byte[] data =Encoding.ASCII.GetBytes("");
            FileTable ft = new FileTable { Id = id, Name = "z.xlsx", Created = DateTime.Now, Size = data.Length };
                context.Add(ft);
            context.Add(new FileDataTable { Id = id, Data = data , FileTable=ft});
            return ft;
        }

    }
   

}
